<!-- Controls & Pages -->
<script id="tmpl-controls-FwReport-Email" type="text/html">
<div style="width:540px;">
  <div class="formrow">
    <div class="fwcontrol fwcontainer fwform-fieldrow" data-control="FwContainer" data-type="fieldrow">
      <div data-datafield="from" data-control="FwFormField" data-type="text" class="fwcontrol fwformfield" data-caption="From" data-enabled="false"></div>
    </div>
    <div class="fwcontrol fwcontainer fwform-fieldrow" data-control="FwContainer" data-type="fieldrow">
      <div data-datafield="tousers" data-control="FwFormField" data-type="multiselectvalidation" class="fwcontrol fwformfield" data-caption="To (Users)" data-validationname="WebUsersEmailValidation" data-hasselectall="false" style="float:left;box-sizing:border-box;width:20%;"></div>
      <div data-datafield="to" data-control="FwFormField" data-type="text" class="fwcontrol fwformfield" data-caption="To" data-enabled="true" style="float:left;box-sizing:border-box;width:80%;"></div>
    </div>
    <div class="fwcontrol fwcontainer fwform-fieldrow" data-control="FwContainer" data-type="fieldrow">
      <div data-datafield="ccusers" data-control="FwFormField" data-type="multiselectvalidation" class="fwcontrol fwformfield" data-caption="CC (Users)" data-validationname="WebUsersEmailValidation"  data-hasselectall="false" style="float:left;box-sizing:border-box;width:20%;"></div>
      <div data-datafield="cc" data-control="FwFormField" data-type="text" class="fwcontrol fwformfield" data-caption="CC" data-enabled="true" style="float:left;box-sizing:border-box;width:80%;"></div>
    </div>
    <div class="fwcontrol fwcontainer fwform-fieldrow" data-control="FwContainer" data-type="fieldrow">
      <div data-datafield="subject" data-control="FwFormField" data-type="text" class="fwcontrol fwformfield" data-caption="Subject" data-enabled="true"></div>
    </div>
    <div class="fwcontrol fwcontainer fwform-fieldrow" data-control="FwContainer" data-type="fieldrow">
      <div data-datafield="body" data-control="FwFormField" data-type="textarea" class="fwcontrol fwformfield" data-caption="Body" data-enabled="true"></div>
    </div>
  </div>
</div>
</script>

</div>

</script>

<script type="text/javascript">
  // inline templates when debugging by ajaxing for the src url
  var $templates = jQuery('script[data-ajaxload="true"]');
  $templates.each(function () {
    if (jQuery(this).attr("src")) {
      jQuery.ajax(
        jQuery(this).attr("src"),
        {
          async: true,
          context: this,
          success: function (data) { jQuery(this).html(data); }
        }
      );
    }
  });
</script>
